from django.db import modelsfrom .models_FSJUser import FSJUserfrom .forms import ProfileFormfrom django.utils.translation import gettext_lazy as _from django.forms import *class Coordinator(FSJUser):    def user_class(self):        return "Coordinator"        def get_profile_form(self, request=None):        if request and request.POST:            profile_form = CoordinatorProfileForm(request.POST, initial = self.get_profile_initial_data())        else:                  profile_form = CoordinatorProfileForm(initial = self.get_profile_initial_data())        return profile_form        def get_profile_initial_data(self):        initial_data = super(Coordinator, self).get_profile_initial_data()        initial_data['employee_id'] = self.userid        return initial_data        def update_FSJUser_from_profile_form(self, form):        super(Coordinator, self).update_FSJUser_from_profile_form(form)         class CoordinatorProfileForm(ProfileForm):    employee_id = IntegerField()           def __init__(self, *args, **kwargs):        super(CoordinatorProfileForm, self).__init__(*args, **kwargs)                   self.fields['employee_id'].disabled = True  